import React from 'react';
import './KeyMetricsSection.css';

const KeyMetricsSection = () => (
  <div className="key-metrics-section">
    <h2>6. Key Metrics</h2>
    <div className="semi-circle">
      <div className="metric">Customer retention rate</div>
      <div className="metric">User growth rate</div>
      <div className="metric">Conversion rate to premium</div>
      <div className="metric">Referral rate</div>
      <div className="metric">Safety rating impact</div>
    </div>
    <div className="metrics-title">6 Key Metrics</div>
  </div>
);

export default KeyMetricsSection;
